import React from "react";
import { Link } from "react-router-dom";

const linkStyle = {
  display: "block",
  fontSize: "18px",
  marginTop: "20px",
  textDecoration: "none",
  color: "blue",
};

const containerStyle = {
  textAlign: "center",
  padding: "20px",
  fontFamily: "Arial, sans-serif",
};

const Home = () => {
  return (
    <div style={containerStyle}>
      <h1>Welcome to Shopping List App</h1>
      <Link to="/shopping-list" style={linkStyle}>
        Go to Shopping Lists
      </Link>
    </div>
  );
};

export default Home;
